import React from "react";
import { Table } from "react-bootstrap";

const TaskTable = () => {
  return (
    <div className="container mt-5">
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Deadline</th>
            <th>Priority</th>
            <th>Is Complete</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>{/* Rows will be dynamically inserted here */}</tbody>
      </Table>
    </div>
  );
};

export default TaskTable;
